import React from 'react'

const Home = () => {
  return (
    <div className="container text-center my-4">
    <img 
      src="hero.jpg" 
      alt="Hero Banner" 
      style={{
        width: "100%",   // Slightly wider for better presence
        height: "400px", // Increased height for a bolder look
        objectFit: "cover", // Ensures it looks clean without distortion
        display: "block",
        margin: "0 auto", // Centers the image
        borderRadius: "12px", // Adds smooth edges for a modern feel
        boxShadow: "0px 6px 15px rgba(0, 0, 0, 0.2)" // Enhances depth for a premium look
      }}
    />
  </div>
  
  )
}

export default Home
